INSERT INTO `post_request` VALUES ('14', '154', 'jobposting', 'We are looking for young and dynamic software and web developer internees for our offshore office located in Lahore Pakistan.\r\n\r\nCandidates are expected to be quick learners and major focus during internship will be on the following tools and technologies\r\n\r\n1- ASP.Net, C#\r\n2- AJAX\r\n3- ASP\r\n4- SQL Server 2000\r\n5- Basic web design skills (HTML, Javascript).\r\n\r\nCandidate should be able to learn new tools and technologies quickly and must be good at searching the web for required solutions.\r\n\r\nSuccessful completion of the 3 month internship period will lead to Full time employment with an attractive salary package.\r\n\r\nFresh graduates are encouraged to apply as this is a great learning opportunity for the successful candidate.\r\n\r\n \r\n\r\nSalary Range: PKR. 3,000 to 7,000/month\r\n\r\n \r\n\r\nShould have sound knowledge and concepts of OOP, SQL and RDBMS. Candidate must be able to learn and work with content management systems and shopping cart applications. Don\\\'t forget to mention online project links in your resume. Mention clearly if you have worked with Visio, Rational Rose, XML / XSL, AJAX\r\n\r\nMicrosoft certifications in ASP.NET and SQL Server will be a big plus.\r\n\r\nExcellent written English communication is a must.\r\n\r\n \r\n\r\nMust be able to work in Lahore.\r\n\r\n \r\n\r\nCandidates from reputable institutes will be preferred.\r\n\r\n');
INSERT INTO `post_request` VALUES ('18', '414', 'jobposting', 'Dear All,\r\nThere is an internship opportunity in Ufone IT Mediation department for fresh graduates holding a bachelors or masters degree. \r\n \r\nSkills Required:\r\nC, C++, Java\r\n \r\nInterested canditaes should email their CVs on the following address:\r\n \r\natharraf@yahoo.com\r\n \r\nP.S: Last date to apply is 5th feb 2010.\r\n \r\n \r\nRegards,\r\nAmbreen Ashfaq ');
